Reusing/splitting $match results in a mongo aggregation<p>I have a mongo collection that stores data on page views such as location, user type (e.g. admin, user) and time spent on page. I want to use <code>$match</code> to get a subset of the documents and then use <code>$group</code> to group them by state and also by user type. The <code>$match</code> is rather expensive, so I was wondering if there was a way through the aggregation pipeline to somehow reuse the <code>$match</code> and get two sets of grouped data rather than needing to run two aggregates.</p>

<p>Current js pseudocode:</p>

<pre><code>groupedByState = Views.aggregate([
  $match: { ... },
  $group: {
    _id: '$state',
    secondsViewed: { $avg: '$seconds_viewed' },
  },
])

groupedByUserType = Views.aggregate([
  $match: { ... },
  $group: {
    _id: '$user_type',
    secondsViewed: { $avg: '$seconds_viewed' },
  },
])
</code></pre>

