Query With Multi-Level Nested Arrays Using Linq<p>I have a model such as:</p>

<pre><code>{
  nestedArray1: [
    {
      nestedArray2: [
        {
          id: 1
        }
      ]
    }
  ]
}
</code></pre>

<p>I am trying to get the items which contain nestedArray2 with the id value that is among the list <code>x = [1, 2, 3, 4, 5, ...]</code>. </p>

<p>I tried to run the following query with no avail:</p>

<pre><code>var query = model.AsQueryable().Where(m =&gt; m.nestedArray1.Any(s =&gt; s.nestedArray2.Any(m =&gt; ids.Any(id =&gt; id == m.id))));
var results = query.ToListAsync();
</code></pre>

<p>It says that any filter is unsupported.</p>

<p>What is the proper way of writing such a query using Linq?</p>

<p><strong>NOTE:</strong></p>

<p>Here is how I can do it using Mongo query syntax:</p>

<pre><code>db.getCollection('model').find({
    "nestedArray1": {
        $elemMatch:{
            nestedArray2:{
                $elemMatch:{
                  "id" : {$in: [1, 2, 3, 4, 5] }
            }
        }
    }
}
</code></pre>

<p>})</p>

<p>And here is how I can do it using C# without Linq query syntax:</p>

<pre><code>var ids = new List&lt;int&gt;() { 1, 2, 3, 4, 5};
var filter = new FilterDefinitionBuilder&lt;Model&gt;()
        .ElemMatch(p =&gt; p.nestedArray1, new FilterDefinitionBuilder&lt;NestedModel1&gt;()
            .ElemMatch(s =&gt; s.nestedArray2, new FilterDefinitionBuilder&lt;NestedModel2&gt;()
                .In(m=&gt; m.id, ids)));
return await Collection.Find(filter).ToListAsync();
</code></pre>

