MongoDB nested lookup accross 3 collections with array<p>I want to lookup from three collections. The starting point is a collection which has an array in which there are keys with which I want to lookup another collection. With the results from that lookup, I want to do another lookup. I'll try sharing a Mongo playground instance, for comfort.</p>

<p>This is the link to the instance:
<a href="https://mongoplayground.net/p/4rJflL1UF81" rel="nofollow noreferrer">https://mongoplayground.net/p/4rJflL1UF81</a></p>

<p>Using this, you can see the mongodb version as well as the source collections, the query and the actual results.</p>

<p>I've already tried a few approaches:</p>

<pre><code>db.SlittingPatterns.aggregate([
  {
    "$lookup": {
      "from": "Orders",
      "localField": "STPO.AUFNR",
      "foreignField": "OrderHead.AUFNR",
      "as": "ORDERS"
    }
  },
  {
    "$lookup": {
      "from": "Materials",
      "localField": "ORDERS.OrderHead.MATNR",
      "foreignField": "MATERIAL.AS_MARA.MATNR",
      "as": "MATERIALS"
    }
  }
])


db.SlittingPatterns.aggregate([
    {
        "$lookup": {
            "from": "Orders",
            "let": {
                "aufnr": "$STPO.AUFNR"
            },
            "pipeline": [
                {
                    "$match": {
                        "$expr": {
                            "$eq": [
                                "$OrderHead.AUFNR",
                                "$$aufnr"
                            ]
                        }
                    }
                },
                {
                    "$lookup": {
                        "from": "Materials",
                        "let": {
                            "matnr": "$OrderHead.MATNR"
                        },
                        "pipeline": [
                            {
                                "$match": {
                                    "$expr": {
                                        "$eq": [
                                            "$MATERIAL.AS_MARA.MATNR",
                                            "$$matnr"
                                        ]
                                    }
                                }
                            }
                        ],
                        "as": "MATERIALS"
                    }
                },
                {
                    "$unwind": "$MATERIALS"
                }
            ],
            "as": "ORDERS"
        }
    },
    {
        "$unwind": "$ORDERS"
    }
])
</code></pre>

<p>The last one was inspired from this question:</p>

<p><a href="https://stackoverflow.com/questions/50584694/lookup-nested-array-in-mongodb">$lookup nested array in mongodb</a></p>

<p>Which seems pretty close to what I want, however it seems because the keys in the STPO array are inside objects, it doesn't work. If I switch</p>

<pre><code>"let": {
  "aufnr": "$STPO.AUFNR"
}
</code></pre>

<p>with</p>

<pre><code>"let": {
  "aufnr": "$STKO.RUNNR"
}
</code></pre>

<p>The desired format is being generated, but it's still not correct, because the AUFNRs need to be collected from the STPO array.</p>

<p>The first one fetches all the data I want, but not in the format I want, which will follow shortly. I propably just need to transform this result further inside my query, but at the moment, I can't figure out how. I also can't show what I already tried on that front, because I haven't gotten anywhere near close my desired format with that.</p>

<p>Here is the expected result:</p>

<pre><code>[
  {
    "ORDERS": [
      {
        "MATERIALS": [
          {
            "MATERIAL": {
              "AS_MARA": {
                "MATNR": "456"
              }
            },
            "_id": ObjectId("5a934e000102030405000000")
          }
        ],
        "OrderHead": {
          "AUFNR": "123",
          "MATNR": "456"
        },
        "_id": ObjectId("5a934e000102030405000003")
      },
      {
        "MATERIALS": [
          {
            "MATERIAL": {
              "AS_MARA": {
                "MATNR": "654"
              }
            },
            "_id": ObjectId("5a934e000102030405000001")
          }
        ],
        "OrderHead": {
          "AUFNR": "321",
          "MATNR": "654"
        },
        "_id": ObjectId("5a934e000102030405000004")
      }
    ],
    "STKO": {
      "RUNNR": "123"
    },
    "STPO": [
      {
        "AUFNR": "123"
      },
      {
        "AUFNR": "321"
      }
    ],
    "_id": ObjectId("5a934e000102030405000005")
  }
]
</code></pre>

