How to query "any" in MongoDB using Mongoose?<p>I'm searching the web and can't find the right way to make a query in my MongoDB using Mongoose.</p>

<p>I want to perform a query if I receive the parameter:</p>

<pre><code>async list(req, res) {
    const { page = 1, limit = 10, status = "" } = req.query;

    const orders = await Order.paginate(
      { status },
      {
        page: parseInt(page),
        limit: parseInt(limit),
        populate: { path: "user", select: "firstName lastName" }
      }
    );
    return res.send(orders);
  }
</code></pre>

<p>So for example, if status is not provided in the URL, I want to return all documents, and if I provide the status, return only the ones that match.</p>

<p>I can achieve what I'm looking for if I pass a status, but I can't return all documents if I don't pass a status. I tried with <code>""</code>, <code>undefined</code> and <code>null</code>, but none of them worked.</p>

<p>I also think the way I'm approaching it is not the best, because I'll have to declare in <code>const { page = 1, limit = 10, status = "" } = req.query;</code> all possible query parameters.</p>

<p>How should I handle it?</p>

<p>PS: I'm using <code>mongoose-paginate</code>, but they redirect the <code>query</code> documentation to the MongoDB documentation, so I assume it's the same.</p>

<p>Thanks in advance!</p>

