How can I perform multiple $lookup's on a query whose results have similar lookup values?<p>I'm performing a query on a large number of documents from a collection whose schema looks like this:</p>

<pre><code>let mySchema = mongoose.Schema({
title: {
    type: String
},
user: {
    type: mongoose.Schema.Types.ObjectId,
    ref: 'User'
},
company: {
    type: mongoose.Schema.Types.ObjectId,
    ref: 'Company'
},
....
});
</code></pre>

<p>Many of the documents in the above schema will have similar values for <code>user</code> and <code>company</code> and I'm trying to find the most efficient way to perform this query. Here is what I have, but I feel like it isn't as performant as it could be:</p>

<pre><code>this.model('MyModel')
    .aggregate([
        {$match: match_stuff_here},
        $lookup: {
            from: "users",
            localField: "user",
            foreignField: "_id",
            as: "user"
        }
        $lookup: {
            from: "companies",
            localField: "company",
            foreignField: "_id",
            as: "company"
        }
        {$project: {
            _id: 1,
            title: 1,
            "user._id": 1,
            "user.name": 1,
            "company._id": 1,
            "company.name": 1
        }}
    ])
    .exec(function (err, data) {
        ...
    });
</code></pre>

<p>It seems like maybe I should somehow group all of the common user ids and company ids together, do a lookup on them as a group, then add the results back in to the original <code>match</code> results. I'm not sure how to do this, or even if that's the right approach. Any ideas on how to optimize this query? Thanks ahead of time!</p>

